import React, { Component } from 'react';
import { Parallax } from 'react-parallax';


import './Home.css';
const image1 = "https://images.squarespace-cdn.com/content/v1/55c65f79e4b050fe363bd50c/1440904526335-XA8GH1SJQ4RN4886NUMD/ke17ZwdGBToddI8pDm48kCX-V5vw-8h9IBXN10-_8XN7gQa3H78H3Y0txjaiv_0fDoOvxcdMmMKkDsyUqMSsMWxHk725yiiHCCLfrh8O1z4YTzHvnKhyp6Da-NYroOW3ZGjoBKy3azqku80C789l0p4Wyba38KfG317vYluk45_zZdtnDCZTLKcP2mivxmYi50xvY5saIGKMgOza9mH4XA/FrontPatio.jpg";

class HomePage extends Component {
    render() {
        return (
           <div>
               <Parallax 
                    bgImage={image1} 
                    renderLayer={percentage => (
                        <div
                            style={{
                                position: 'absolute',
                                background: `rgba(255, 125, 0, ${percentage * 1})`,
                                left: '50%',
                                top: '50%',
                                width: percentage * 500,
                                height: percentage * 500,
                            }}
                        />
                    )}
                >

               </Parallax>
               <Parallax bgImage={image1} strength={500}>
                    <div className="parallaxSize">
                        <div className="inside">

                        </div>
                    </div>
               </Parallax>

           </div>
        )
    }   
}


export default HomePage;
